import React from 'react';
import { Helmet } from 'react-helmet';

const Header = () => {
  return (
    <div>
      <Helmet>
        <style>{'margin-top: 50px'}</style>
      </Helmet>
      <h1 className="header">Thanawat Gulati</h1>
    </div>
  );
};

export default Header;
